import axios from 'axios';
import React, { useEffect, useState } from 'react'

const Table = () => {
  const [tableData,setTableData] = useState([]);
  console.log(tableData,"table data")

  const fetchData = async()=>{
    try{
        const response= await axios.get("http://localhost:3001/api/table")
        if(response){
          setTableData(response?.data)
        }
    }catch(err){
       console.log(err,"data fetching error")
    }
  }
useEffect(()=>{
  fetchData()
},[])

  return (
    <div className='rounded-l-md rounded-r-md bg-green-500 mx-10 w-1/2  h-20'>
    <div className="flex flex-col">
      <div className="overflow-x-auto sm:-mx-6 lg:-mx-8">
        <div className="inline-block min-w-full py-2 sm:px-6 lg:px-8">
          <div className="overflow-hidden">
            <table className="min-w-full text-left text-sm font-light">
              <thead
                className="border-b bg-white font-medium dark:border-neutral-500 dark:bg-zinc-500">
                <tr>
                  <th scope="col" className="px-6 py-4">Id</th>
                  <th scope="col" className="px-6 py-4">Name</th>
                  <th scope="col" className="px-6 py-4">Quantity</th>
                  <th scope="col" className="px-6 py-4">Price</th>
                </tr>
              </thead>
              <tbody>
              {tableData?.map((item)=>(
                <tr key={item?.id}
                  className="border-b bg-neutral-100 dark:border-neutral-500 dark:bg-neutral-700">
                  <td className="whitespace-nowrap px-6 py-4 font-medium">{item?.id}</td>
                  <td className="whitespace-nowrap px-6 py-4">{item?.name}</td>
                  <td className="whitespace-nowrap px-6 py-4">{item?.quantity}</td>
                  <td className="whitespace-nowrap px-6 py-4">{item?.price}</td>
                </tr>
              ))}
                
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>

    </div>
  )
}

export default Table
